import circle from "./photo/Group 1.svg"
import './App.css';
import arrow from "./photo/Arrow 1.svg"
import Tilt from 'react-parallax-tilt';
import { motion, useViewportScroll, useTransform } from "framer-motion";

function App() {

  return (
    <div className="body">

        <motion.h1
            style={{
                zIndex: 20,
        }}
            className="back-page">CREATIVE NEW DESIGN</motion.h1>

     <header className="header">
       <p className="logo">logo</p>
         <div className="links">
             <a href="#">menu</a>
             <a href="#">creative</a>
             <a href="#">contact</a>
         </div>
     </header>

        <div className="main-block-page">

        <div className="main-page">

            <motion.div
                initial={{ scale: 0 }}
                animate={{ scale: 1 }}
                className="main-box">
                <motion.h1 >CREATIVE NEW DESIGN</motion.h1>
                <Tilt>
                <motion.img

                    initial={{ scale: 0 }}
                    whileInView={{ opacity: 1, scale: 1 }}
                    whileTap={{
                        scale: 0.9
                    }}
                    whileHover={{scale: 1.1}}
                    style={{

                    height: 300,
                }
                }
                    src={circle}/>
                </Tilt>
            </motion.div>

        </div>


        <div className="btn-scroll">
            <p className="scr-btn">Scroll Down</p>
