          </div>
        <div className="footer">
            <svg width="43" height="49" viewBox="0 0 43 49" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M36.8313 10.3811C36.5037 10.2117 36.1848 10.0261 35.8757 9.82489C34.977 9.23076 34.153 8.53069 33.4215 7.73978C31.5912 5.64557 30.9076 3.52102 30.6559 2.03354H30.666C30.4556 0.798853 30.5426 0 30.5558 0H22.2194V32.2353C22.2194 32.668 22.2194 33.0958 22.2012 33.5185C22.2012 33.5711 22.1961 33.6196 22.1931 33.6762C22.1931 33.6995 22.1931 33.7237 22.188 33.748V33.7662C22.1001 34.9228 21.7294 36.0401 21.1084 37.0198C20.4873 37.9994 19.6351 38.8115 18.6265 39.3845C17.5754 39.9825 16.3866 40.2961 15.1773 40.2946C11.2933 40.2946 8.14538 37.1275 8.14538 33.2161C8.14538 29.3048 11.2933 26.1377 15.1773 26.1377C15.9125 26.137 16.6433 26.2527 17.3423 26.4805L17.3524 17.9924C15.2303 17.7183 13.0743 17.8869 11.0206 18.4877C8.96691 19.0885 7.06 20.1084 5.42018 21.4831C3.98332 22.7315 2.77535 24.2211 1.85062 25.8849C1.49872 26.4916 0.171007 28.9296 0.0102252 32.8865C-0.0908955 35.1324 0.583579 37.4591 0.905143 38.4208V38.441C1.10738 39.0073 1.89107 40.9397 3.16822 42.5688C4.19807 43.8755 5.41481 45.0234 6.77924 45.9755V45.9553L6.79947 45.9755C10.8352 48.7179 15.3098 48.5379 15.3098 48.5379C16.0844 48.5066 18.6791 48.5379 21.6258 47.1415C24.894 45.5933 26.7546 43.2867 26.7546 43.2867C27.9433 41.9085 28.8885 40.3379 29.5496 38.6423C30.304 36.6593 30.5558 34.2809 30.5558 33.3304V16.2289C30.6569 16.2895 32.0038 17.1804 32.0038 17.1804C32.0038 17.1804 33.9443 18.4242 36.9719 19.2342C39.1439 19.8106 42.0704 19.9319 42.0704 19.9319V11.6562C41.045 11.7674 38.9629 11.4438 36.8313 10.3811Z" fill="white" fill-opacity="0.2"/>
            </svg>

        </div>
    </div>
    </div>
  );
}

export default App;
